Bay of Angels

=======

Jean is a clerk in a bank. His colleague Caron is a gambler and gives him the
virus. In the casinos, Jean meets Jackie. Their love affair follows their luck
at the roulette.

A bottle-blonde Jeanne Moreau is at her blithe best as a gorgeous gambling
addict, and Claude Mann is the bank clerk drawn into her risky world.
Featuring a mesmerizing score by Michel Legrand, Bay of Angels is among
Demy's most somber works.

